const Alert_66 = ( msg, type, removeAlert ) => {
  useEffect(() => {
    const timeout = setTimeout(() => {
      removeAlert();
    }, 3000);
  });

  return <p className={`alert alert-${type}`}>{msg}</p>
};

export default Alert_66
